import logo from './logo.svg';
import './App.css';

const Button = styled.button`
  background-color: black;
  color: white;
  font-size: 20px;
  padding: 10px 60px;
  border-radius: 5px;
  margin: 10px 0px;
  cursor: pointer;
`;

function App() {
  return (
    <button onClick={sayHello}>Ceci est un bouton</button>
  );
}

export default App;

function sayHello() {
  alert('Bonjour !');
}
